member.remarks:
Used to declare a special iterator function. Examples: iterfunc stock OnlyZero(cur)
{
if (cur == -1)
return 0;
return -1;
}
iterfunc stock AlsoOnlyZero[cellmin](cur)
{
if (cur == cellmin)
return 0;
return cellmin;
}
iterfunc stock OneToTen[cellmin](cur)
{
if (cur == cellmin)
return 1;
if (cur == 10)
return cellmin;
return cur + 1;
}
iterfunc stock OneToN(cur, n)
{
if (n < 1)
return -1;
if (cur == -1)
return 1;
if (cur == n)
return -1;
return cur + 1;
}
